import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  height: 100vh;
  font-family: "Segoe UI", Tahoma, Geneva, Verdana, sans-serif;
  background-color: #f1f1f1;
`;

const LeftPanel = styled.div`
  background-color: #2f6f69;
  color: white;
  flex: 1;
  display: flex;
  flex-direction: column;
  padding: 3rem 2rem;
  justify-content: space-between;
  max-width: 450px;
`;

const BrandName = styled.h1`
  font-weight: 700;
  font-size: 1.8rem;
  margin: 0;
`;

const Tagline = styled.div`
  margin-top: 3rem;
`;

const TaglineTitle = styled.h2`
  font-weight: 700;
  font-size: 1.25rem;
  margin-bottom: 0.5rem;
`;

const TaglineText = styled.p`
  font-weight: 400;
  font-size: 0.875rem;
  line-height: 1.4;
`;

const ImageWrapper = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  flex-grow: 3;
  margin-top: 3rem;
`;

const StethoscopeImg = styled.img`
  max-width: 100%;
  height: auto;
  object-fit: contain;
`;

const FooterDots = styled.div`
  display: flex;
  justify-content: flex-start;
  margin-top: 1rem;
  gap: 0.5rem;
`;

const Dot = styled.span`
  width: 8px;
  height: 8px;
  background-color: ${({ active }) => (active ? "white" : "rgba(255,255,255,0.5)")};
  border-radius: 50%;
`;

const RightPanel = styled.div`
  background-color: white;
  flex: 2;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  padding: 2rem 3rem;
`;

const EmailIconWrapper = styled.div`
  background-color: #dae8e5;
  width: 85px;
  height: 85px;
  border-radius: 50%;
  display: flex;
  justify-content: center;
  align-items: center;
`;

const EmailIcon = () => (
  <svg
    width="45"
    height="45"
    viewBox="0 0 24 24"
    fill="#2f6f69"
    xmlns="http://www.w3.org/2000/svg"
  >
    <path d="M20 4H4C2.895 4 2 4.895 2 6V18C2 19.105 2.895 20 4 20H20C21.103 20 22 19.105 22 18V6C22 4.895 21.103 4 20 4Z" />
    <path
      fill="#fff"
      d="M20 6L12 13L4 6H20Z"
    />
  </svg>
);

const Title = styled.h2`
  margin-top: 1.5rem;
  font-weight: 700;
  font-size: 1.25rem;
  color: #2f6f69;
`;

const Description = styled.p`
  margin-top: 0.75rem;
  font-weight: 400;
  font-size: 0.875rem;
  text-align: center;
  max-width: 320px;
  color: #334d4a;

  & b {
    font-weight: 600;
  }
`;

const EmailAddress = styled.b`
  color: #2f6f69;
`;

const Button = styled.button`
  margin-top: 2rem;
  background-color: #2f6f69;
  color: white;
  font-weight: 600;
  border: none;
  padding: 0.75rem 2.25rem;
  border-radius: 8px;
  cursor: pointer;
  font-size: 0.95rem;
  transition: background-color 0.3s;

  &:hover {
    background-color: #25554f;
  }
`;

const FooterText = styled.p`
  margin-top: 1.25rem;
  font-weight: 400;
  font-size: 0.85rem;
  color: #334d4a;

  a {
    color: #2f6f69;
    text-decoration: none;
    font-weight: 600;
    margin-left: 0.25rem;
    cursor: pointer;

    &:hover {
      text-decoration: underline;
    }
  }
`;

const PasswordResetSent = () => {
  const userEmail = "abc@gmail.com";

  const handleOpenEmail = () => {
    // Example: open mail client or redirect
    window.open("mailto:" + userEmail, "_blank");
  };

  const handleResendEmail = () => {
    alert("Resend email functionality triggered");
    // Here implement resend logic like calling API
  };

  return (
    <Container>
      <LeftPanel>
        <BrandName>Medicore</BrandName>

        <ImageWrapper>
          <StethoscopeImg
            src="https://upload.wikimedia.org/wikipedia/commons/thumb/8/88/Stethoscope_in_Blue.svg/1200px-Stethoscope_in_Blue.svg.png"
            alt="Stethoscope"
          />
        </ImageWrapper>

        <Tagline>
          <TaglineTitle>Smarter Care Starts Here</TaglineTitle>
          <TaglineText>
            MediCore unites patients and professionals—simplifying care, records, and billing.
          </TaglineText>

          <FooterDots>
            <Dot active />
            <Dot />
            <Dot />
          </FooterDots>
        </Tagline>
      </LeftPanel>

      <RightPanel>
        <EmailIconWrapper>
          <EmailIcon />
        </EmailIconWrapper>

        <Title>Email Sent</Title>

        <Description>
          An email with password reset link has been sent to{" "}
          <EmailAddress>{userEmail}</EmailAddress>. Open it to reset your password.
        </Description>

        <Button onClick={handleOpenEmail}>Open Email</Button>

        <FooterText>
          Didn’t receive email?
          <a onClick={handleResendEmail}>Resend Email</a>
        </FooterText>
      </RightPanel>
    </Container>
  );
};

export default PasswordResetSent;
